import React, { Component } from "react";

class LatestPosition extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="latest-position">
        <div className="more-positions">
          <span>最新职位</span>
          <span>更多</span>
        </div>
        <div className="positions-content">
          <ul>
            <li>
              <a href='www.albb.com'>蚂蚁金服-国际技术合规专家</a>
              <em className="time">30分钟前</em>
              <em className="city" title="北京,杭州">北京,杭州</em>
            </li>
          </ul>
        </div>
      </div>
    );
  }
}

export default LatestPosition;
